import React from "react"

import {
    BrowserRouter as Router,
    Switch,
    Route,
    NavLink
  } from "react-router-dom";

function Menu(){

    return (
        <div className="menu-container">

            <Router>
                <div className="menu-flex-box">

                    <div className="menu-item">
                        <NavLink exact to="/" activeClassName="active-link">VIAJES</NavLink>
                    </div>
                    <div className="menu-item">
                        <NavLink exact to="/experiencia">BIENES RAICES</NavLink>
                    </div>
                    <div className="menu-item">
                        <NavLink exact to="/viaja">COMERCIALES</NavLink>
                    </div>
                    <div className="menu-item">
                        <NavLink exact to="/galeria" activeClassName="active-link">CINEMATOGRAFIA</NavLink>
                    </div>

                    <div className="menu-item">
                        <NavLink exact to="/servicios" activeClassName="active-link">TERRENOS </NavLink>
                    </div>

                </div>

                <Switch>
                    <Route exact path="/">
                        <Inicio />
                    </Route>
                    <Route path="/galeria">
                        <Galeria />
                    </Route>
                    <Route path="/servicios">
                        <Servicios />
                    </Route>
                </Switch>

            </Router>
        </div>
    );
}

function Inicio() {
    return (
        <div className="inicio">
            <FirstPart />
            <SecondPart />
            <ThirdPart />
            <Footer />;
        </div>
    );
  }

  function Galeria() {
    return (
        <div className="galeria">
            <GalleryFirstPart />
            <GallerySecondPart />
            <Footer />
        </div>
    );     
  }

  function Servicios() {
    return (
        <div className="servicios">
            <AboutFirstPart />
            <AboutTitle title1="EXPERIENCES " title2="leave memories"/>
            <AboutSecondPart />
            <AboutTitle title1="MEMORIES " title2="last forever"/>
            <AboutThirdPart />
            <AboutFourthPart />
            <AboutFifthPart />
            <Footer />  
        </div>
    );
}

export default Menu
